  "Success": {
    "Success": {
      "1": "\n                    \n<div class=\"smbc-panel smbc-panel--confirmation\">\n    <h1 class=\"govuk-panel__title\">We've received your report</h1>\n\n        <div class=\"govuk-body-l\">Thanks for reporting a flood</div>\n\n        <div class=\"smbc-panel__body smbc-!-font-word-break\">Your reference number is: <strong>123456</strong></div>\n</div>\n\n<h2 class=\"govuk-heading-m\">What happens next</h2>\n<p class=\"smbc-body\">If you've provided your email address you'll receive a confirmation email.</p>\n<p class=\"smbc-body\">We'll review your report and investigate further if needed.</p>\n<p class=\"smbc-body\">We'll monitor and assess flooding trends or wider issues. Flooding in a home, business or on private land is for the owner to resolve, however we can give you advice.</p>\n<p class=\"smbc-body\">If we need more information, we'll get in touch with you.</p>\n<div class=\"govuk-button-group\">\n    <a href=\"https://www.stockport.gov.uk/\" rel=\"noreferrer noopener\" target=\"_blank\" class=\"govuk-button\">\n        Go to the homepage\n    </a>\n</div>\n\n\n\n                "
    }
  },
